#include<bits/stdc++.h>using namespace std;typedef long long ll;int main(){    ios::sync_with_stdio(0);    cin.tie(0);    ll t;    cin>>t;    while(t--){        ll n,k;        cin>>n>>k;        vector<ll> a(n);        map<ll,ll> mp;        for(int i=0;i<n;i++){            cin>>a[i];            mp[a[i]]++;        }        vector<ll> ans(3,0);        // cout<<"ans=";        if(mp.size()==n){            ans[0]=a[0];            ans[1]=a[1];            ans[2]=a[2];            for(int i=0;i<k;i++){                cout<<ans[i%3]<<" ";            }            cout<<endl;        }        else{            ans[2]=a[n-1];            for(int i=1;i<=n;i++){                if(mp.find(i)==mp.end()){                    if(ans[0]==0)ans[0]=i;                    else ans[1]=i;                                    }                else{                    if(i!=a[n-1])ans[1]=i;                }            }            for(int i=0;i<k;i++){                cout<<ans[i%3]<<" ";            }            cout<<endl;        }    }}